import React, { useState } from "react";
import "./FindFreelancers.css";

const freelancers = [
  {
    id: 1,
    name: "Sarah Johnson",
    title: "Full Stack Developer",
    rating: 4.9,
    hourlyRate: 85,
    skills: ["React", "Node.js", "TypeScript"],
    image: "https://images.unsplash.com/photo-1494790108377-be9c29b29330",
    location: "San Francisco, CA",
    availability: "Available now",
  },
  {
    id: 2,
    name: "Michael Chen",
    title: "UI/UX Designer",
    rating: 4.8,
    hourlyRate: 75,
    skills: ["Figma", "Adobe XD", "Sketch"],
    image: "https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d",
    location: "New York, NY",
    availability: "Available in 2 weeks",
  },
];

const skillsList = ["React", "Node.js", "TypeScript", "Figma", "Adobe XD", "Sketch"];

export default function FindFreelancers() {
  const [searchQuery, setSearchQuery] = useState("");
  const [rateRange, setRateRange] = useState(150);
  const [selectedSkills, setSelectedSkills] = useState([]);
  const [hoveredFreelancer, setHoveredFreelancer] = useState(null);

  const handleSkillSelection = (skill) => {
    setSelectedSkills((prevSkills) =>
      prevSkills.includes(skill)
        ? prevSkills.filter((s) => s !== skill)
        : [...prevSkills, skill]
    );
  };

  const filteredFreelancers = freelancers.filter(
    (freelancer) =>
      freelancer.name.toLowerCase().includes(searchQuery.toLowerCase()) &&
      freelancer.hourlyRate <= rateRange &&
      (selectedSkills.length === 0 || freelancer.skills.some((skill) => selectedSkills.includes(skill)))
  );

  return (
    <div className="container">
      {/* Sidebar */}
      <aside className="sidebar">
        <div className="filter-section">
          <h3>Search</h3>
          <input
            type="text"
            placeholder="Search freelancers..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
        </div>

        <div className="filter-section">
          <h3>Hourly Rate</h3>
          <input
            type="range"
            min="0"
            max="150"
            value={rateRange}
            onChange={(e) => setRateRange(e.target.value)}
          />
          <p>${rateRange}/hr</p>
        </div>

        <div className="filter-section">
          <h3>Skills</h3>
          <div className="skills-container">
            {skillsList.map((skill) => (
              <button
                key={skill}
                className={`skill-chip ${selectedSkills.includes(skill) ? "selected" : ""}`}
                onClick={() => handleSkillSelection(skill)}
              >
                {skill}
              </button>
            ))}
          </div>
        </div>

        <button className="cta-button">
          Can't find the right talent? <br /> Post your project
        </button>
      </aside>

      {/* Freelancers Grid */}
      <main className="content">
        <div className="grid">
          {filteredFreelancers.map((freelancer) => (
            <div
              key={freelancer.id}
              className={`card ${hoveredFreelancer === freelancer.id ? "hovered" : ""}`}
              onMouseEnter={() => setHoveredFreelancer(freelancer.id)}
              onMouseLeave={() => setHoveredFreelancer(null)}
            >
              <img className="profile-image" src={`${freelancer.image}?w=400`} alt={freelancer.name} />
              <div className="card-content">
                <h4>{freelancer.name}</h4>
                <p className="title">{freelancer.title}</p>
                <div className="rating">
                  ‚≠ê {freelancer.rating}
                </div>
                <p className="rate">${freelancer.hourlyRate}/hr</p>
                <div className="skills">
                  {freelancer.skills.map((skill) => (
                    <span key={skill} className="skill-badge">{skill}</span>
                  ))}
                </div>
                <button className="contact-button">Contact Freelancer</button>
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
}
